reviews.review_text:
Thrilling Come Back Tour I love the energy, the triumph, the "so there" to the 80's;
I love So Glad You Made It -- we all meant it, really meant it, and I'd be fine if they opened every show with that one like they played tonight (opening tonight with Touch of Grey was A-OK, it made all the new deadheads feel welcomed).
Its true, somehow or another NYC always brought out the best in the Dead.

I hope the MSG stand makes makes the cut for the Scorsese documentary;  

See this as you tune in:

http://www.psmag.com/navigation/books-and-culture/if-you-get-confused-just-listen-to-the-music-play-grateful-dead-96499/
